var batchSize = 100;
var cont, pagination;
var alphabetsCont = jQuery('#alphabets');
var albumsCont = jQuery('#albums');
var artistsCont = jQuery('#artists');
var songbookTitle = jQuery('#songbookTitle');

function loadData() {
	var currURL = window.location.href;
	if(currURL.indexOf('tamil') != -1) {
	    data = tamilSongs;
	    songbookTitle.text('கிறிஸ்தவ பாடல்கள்');
	} else if(currURL.indexOf('english') != -1) {
	    data = englishSongs;
	    songbookTitle.text('English Christian Songs');
	} else if(currURL.indexOf('malayalam') != -1) {
	    data = malayalamSongs;
	} else if(currURL.indexOf('hindi') != -1) {
	    data = hindiSongs;
	    songbookTitle.text('क्रिश्तिया गीत');
	} else if(currURL.indexOf('album') != -1) {
	    filterAlbum();
	} else if(currURL.indexOf('artist') != -1) {
	    filterArtist();
	}
};

loadData();

constructAlphabets();

jQuery(document).ready(function() {
    cont = jQuery('#songsContainer');
    pagination = jQuery('#paginationContainer');
    pageInfoEl = jQuery('#pageInfoEl');
    fetch();

    albumsCont.html('');
    albums.forEach(function(item, index) {
    	var li = jQuery('<li>');
    	var a = jQuery('<a href="album.php?id=' + item.id + '" data-index="' + index + '">' + item.title + '</a>');
    	a.on('click', handleAlbumClick);
    	li.append(a);
        albumsCont.append(li);
    });

    artistsCont.html('');
    artists.forEach(function(item, index) {
    	var li = jQuery('<li>');
    	var a = jQuery('<a href="artist.php?id=' + item.id + '" data-index="' + index + '">' + item.title + '</a>');
    	a.on('click', handleArtistClick);
    	li.append(a);
        artistsCont.append(li);
    });
});

function constructAlphabets() {
    var alphabets = [];
    data.forEach(function(item) {
        var letter = item.title[0];
        if(alphabets.indexOf(letter) === -1) {
            alphabets.push(letter);
        }
    });

    var page = window.location.pathname.split('/').pop() + '?';
    if(page.indexOf('album') !== -1 || page.indexOf('artist') !== -1) {
        page += 'id=' + HTTP_GET['id'] + '&';
    } 

    alphabetsCont.html('');
    alphabets.forEach(function(item, index) {
        var li = jQuery('<li>');
        var a = jQuery('<a href="' + page + 'lang=' + HTTP_GET['lang'] + '&' + 's=' + item + '" data-index="' + index + '">' + item + '</a>');
        a.on('click', handleAlphabetClick);
        li.append(a);
        alphabetsCont.append(li);
    });
};

function handleSongbookClick(event) {
	var el = jQuery(event.currentTarget);
	HTTP_GET = getQueryParams(window.location.search);
	var lang = HTTP_GET['lang'];
    window.history.pushState('songbook_' + lang, lang[0].toUpperCase() + lang.substr(1, lang.length) + ' Christian Songs | APA Mission', el.attr('href'));
    loadData();
    constructAlphabets();
    fetch();
    event.preventDefault();
    event.stopPropagation();
    return false;
};

function handleAlphabetClick(event) {
    var el = jQuery(event.currentTarget);
    var index = el.attr('data-index');
    window.history.pushState('alpha' + index, el.text(), el.attr('href'));
    HTTP_GET = getQueryParams(window.location.search);
    fetch();
    event.preventDefault();
    event.stopPropagation();
    return false;
};

function handleAlbumClick(event) {
	var el = jQuery(event.currentTarget);
	var index = el.attr('data-index');
	window.history.pushState('album' + index, el.text(), el.attr('href'));
	HTTP_GET = getQueryParams(window.location.search);
	filterAlbum();
    constructAlphabets();
	fetch();
	event.preventDefault();
	event.stopPropagation();
	return false;
};

function handleArtistClick(event) {
	var el = jQuery(event.currentTarget);
	var index = el.attr('data-index');
	window.history.pushState('artist' + index, el.text(), el.attr('href'));
	HTTP_GET = getQueryParams(window.location.search);
	filterArtist();
    constructAlphabets();
	fetch();
	event.preventDefault();
	event.stopPropagation();
	return false;
};

function filterAlphabets() {
    var alphabet = HTTP_GET['s'];
    if(alphabet) {
        var filteredData = data.filter(function(item) {
            return item.title.startsWith(alphabet);
        });
        return filteredData;
    }
};

function filterAlbum() {
	var albumId = HTTP_GET['id'];
    data = tamilSongs.filter(function(item) {
        return item.album == albumId;
    });
    albumInfo = albums.filter(function(item) {
        return item.id == albumId;
    })[0];
    document.getElementById('albumTitle').textContent = albumInfo.title;
    document.title = albumInfo.title + ' | ' + document.title;
};

function filterArtist() {
	var artistId = HTTP_GET['id'];
    data = tamilSongs.filter(function(item) {
        return item.artist == artistId;
    });
    artistInfo = artists.filter(function(item) {
        return item.id == artistId;
    })[0];
    document.getElementById('artistTitle').textContent = artistInfo.title;
    document.title = artistInfo.title + ' | ' + document.title;
};

function fetch() {

    filtered = HTTP_GET['s'] ? filterAlphabets() : data;

    var hash = window.location.hash;
    var pageNo = 1;
    if(hash !== '') {
        pageNo = parseInt(hash.split('#')[1]);
    }
    var start = ((pageNo - 1) * batchSize) + 1;
    cont.attr('start', start);
    var totalLength = Math.ceil(filtered.length / batchSize);

    cont.html('');
    for(var i = start - 1; (i < (start + batchSize - 1) && i < filtered.length); i++) {
    	if(i !== start -1 && i % 30 == 0) {
    		insertAd(cont);
    	}
        var li = jQuery('<li data-id="' + md5(filtered[i].id + 1000) + '°' + filtered[i].id + '°' + md5(filtered[i].id - 1000) + '"><a href="lyrics.php?song=' + filtered[i].title + '&id=' + md5(i) + '°' + filtered[i].id + '°' + md5(i + 1000) + '&i=' + md5(filtered[i].id) + '" target="_blank">' + filtered[i].title + '</a></li>');
        if (filtered[i].youtube && filtered[i].youtube !== "") {
            li.append(jQuery('<a style="color: #f00; margin-left: 10px; cursor: pointer;" target="_blank" href="watch.php?type=y&v=' + filtered[i].youtube + '&title=' + filtered[i].title + '" title="' + filtered[i].title + '"><i class="fab fa-youtube"></i></a>'));
        }
        if (filtered[i].karoke && filtered[i].karoke !== "") {
            li.append(jQuery('<a style="margin-left: 10px; cursor: pointer;" target="_blank" href="watch.php?type=k&v=' + filtered[i].karoke + '&title=' + filtered[i].title + '" title="' + filtered[i].title + '"><i class="fas fa-microphone-alt"></i></a>'));
        }
        cont.append(li);
    }

    pagination.html('');
    if(totalLength > 1) {
        pageInfoEl.text('Song Lyrics (Page ' + pageNo + '/' + totalLength + ')');
        for(var i = 1; i <= totalLength; i++) {
            pagination.append(jQuery('<a href="#' + i + '" style="margin-right: 10px;' + (pageNo == i ? 'font-weight: bold;' : '') + '">' + i + '</a>'));
        }
    } else {
    	pageInfoEl.text('Song Lyrics');
    }

    window.scroll({ top: cont.scrollTop, behavior: 'smooth' });
};

var adIndex = 0;
function insertAd(cont) {
	cont.append(getAdSnippet(adIndex));
	adIndex;
};

window.onhashchange = fetch;
